import React from "react";
import "./Post.css";

const Post = (postId, 
    caption, 
    postImage, 
    likes=[], 
    comments=[], 
    ownerImage, 
    ownerName, 
    ownerId, 
    isDelete = false, 
    isAccount = false) => {
  return (
    <div className="post">Post</div>
  )
}
export default Post;
